import React from "react";
import "./style.css";
import { Row, Col, Button } from "antd";
import { Images } from "./../../config/image";
import Menu from "../../components/menu";
function Home() {
  return (
    <div>
      <div style={{ display: "block" }}>
        <Menu />
        <div>
<Row>
        <Col
          span={13}
          //  style={{ backgroundColor: "blue" }}
        >
          <div style={{ display: "flex", paddingTop: "150px" }}>
            <div style={{ position: "relative", left: "90px" }}>
              <img src={Images.DESKTOP} style={{ width: "320px" }} />
            </div>
            <div
              style={{ position: "absolute", bottom: "10px", left: "250px" }}
            >
              {" "}
              <img src={Images.MONITOR} style={{ width: "400px" }} />
            </div>
            <div
              style={{ position: "absolute", left: "580px", bottom: "10px" }}
            >
              <img src={Images.TABLET} style={{ width: "100px" }} />
            </div>
            <div
              style={{ position: "absolute", left: "555px", bottom: "20px" }}
            >
              <img src={Images.PHONE} style={{ width: "55px" }} />
            </div>
          </div>
        </Col>
        <Col span={8}>
          <div style={{ display: "block", paddingTop: "10px" }}>
            <div
              style={{
                fontSize: "30px",
                color: "#00808b",
                fontFamily: "Anton, sans-serif",
              }}
            >
              KHUNHATRO - CHUOICANHO
            </div>
            <div
              style={{
                fontSize: "30px",
                color: "#00808b",
                fontFamily: "Anton, sans-serif",
              }}
            >
              PHẦN MỀM QUẢN LÝ
            </div>
            <div
              style={{
                fontSize: "30px",
                color: "#00808b",
                fontFamily: "Anton, sans-serif",
              }}
            >
              NHÀ TRỌ CĂN HỘ DỊCH VỤ
            </div>
            <div style={{ paddingTop: "10px" }}>
              <img src={Images.NO1} />
            </div>
            <div
              style={{
                fontFamily: "EB Garamond, serif",
                color: "#00808b",
                fontSize: "18px",
              }}
            >
              Thiết kế đơn giản, dễ dàng sử dụng và tiết kiệm tối đa chi phí
            </div>
            <div className="btnfree">
              <button
                className="button"
                // type="primary"
                //     style={{width:"45%",height:"80%",borderRadius:"20px", fontFamily:"EB Garamond, serif",color:"white",
                //     backgroundColor:"#00808b",
                //     fontSize:"15px"}}
              >
                DÙNG THỬ MIỄN PHÍ{" "}
              </button>
            </div>
          </div>
        </Col>
      </Row>
        </div>
        
      </div>
    </div>
  );
}

export default Home;
